import React, { useState } from 'react';
import Welcome from './Welcome';

export default function App() {
  const { screen, setScreen } = useState(0);


  const getContent = () => {
    if (screen === 0) {
      return <Welcome />;
    }

    return '';
  }

  return getContent();
}
